	add("helicopter", "{\"term\":\"helicopter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{borrowing|fr|hélicoptère|lang\u003den}}, from Ancient greek (to 1453) \u0027ἕλιξ\u0027 (spiral) + \u0027πτερόν\u0027 (wing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aircraft that is borne along by one or more sets of long rotating blades which allow it to hover, move in any direction including reverse, or land; and having a smaller set of blades on its tail that stabilize the aircraft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We flew over the city in a \u0027\u0027helicopter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a powered troweling machine with spinning blades used to spread concrete\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a winged fruit of certain trees, such as ash, elm, and maple\", \"priority\":4}]}, \"synonyms\":{\"list\":[{\"text\":\"chopper\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"copter\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"eggbeater\", \"synonymQualifier\":\"SLANG\"},{\"text\":\"whirlybird\", \"synonymQualifier\":\"SLANG\"}]}}");

