	add("helios", "{\"term\":\"helios\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἥλιος\u0027 from \u0027ἥλιος\u0027 (sun)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The god of the Sun; son of Hyperion and Theia, brother of Selene and Eos, father of Phaeton amongst others. His Roman counterpart is Sol\", \"priority\":1}]}, \"synonyms\":{}}");

