	add("heliotheism", "{\"term\":\"heliotheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|helio|theism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Worship of the Sun; belief that the Sun is a god\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, Joseph McCabe (translator), w:Ernst Heinrich Philipp August Ernst Haeckel (author), \u0027The Riddle of the Universe: At the Close of the Nineteenth Century\u0027, Harper \u0026amp; Brothers Publishers, [http://books.google.com/books?id\u003dMmcFAQAAIAAJ\u0026amp;pg\u003dPA280\u0026amp;dq\u003dheliotheism page 280\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sun-worship (solarism, or \u0027\u0027heliotheism\u0027\u0027) seems to the modern scientist to be the best of all forms of theism, and the one which may be most easily reconciled with modern monism\", \"priority\":3}]}, \"synonyms\":{}}");

