	add("heliotrope", "{\"term\":\"heliotrope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027héliotrope\u0027 from Ancient greek (to 1453) \u0027ἡλιοτρόπιον\u0027 from \u0027ἥλιος\u0027 (sun) + \u0027τρέπω\u0027 (turn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|220 px right|Surveying heliotrope (ca.1878): B.A. Colonna collection (NOAA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A plant that turns so that it faces the sun\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Particularly, a purple-flowered plant of the species\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1870\u0027\u0027, \u0027w:Lothair Lothair\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As they entered now, it seemed a blaze of roses and carnations, though one recognized in a moment the presence of the lily, the \u0027\u0027heliotrope\u0027, and the stock\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A light purple or violet colour\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027\u0027, page 62\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;...the face of Dr. Willi Dingkopf, framed by a haircut in violation of more than one law of physics, and a vivid necktie in fuchsia, heliotrope, and duck green...\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The fragrance of heliotrope flowers\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"he had always smelt so much more of \u0027\u0027heliotrope\u0027\u0027 than of gunpowder\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, \u0027s:The Furnished The Furnished Room\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Ransacking the drawers of the dresser he came upon a discarded, tiny, ragged handkerchief. He pressed it to his face. It was racy and insolent with \u0027\u0027heliotrope\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A bloodstone (a variety of quartz\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An instrument, employed in triangulation, that uses a mirror to reflect sunlight toward another, very distant, surveyor\", \"priority\":14}]}, \"synonyms\":{}}");

	add("heliotropism", "{\"term\":\"heliotropism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|helio|tropism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of some plants of turning under the influence of light; either positively (towards the light) or negatively (away from the light\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Staff (University of Wisconsin-Madison), \u0027Sunflowers inspire more efficient solar power system\u0027, R\u0026amp;D Magazine, [http://www.rdmag.com/News/2012/08/Energy-Sunflowers-Inspire-More-Efficient-Solar-Power-System/ online\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A field of young sunflowers will slowly rotate from east to west during the course of a sunny day, each leaf seeking out as much sunlight as possible as the sun moves across the sky through an adaptation called \u0027\u0027heliotropism\", \"priority\":3}]}, \"synonyms\":{}}");

