	add("helium", "{\"term\":\"helium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|helium}}, from Ancient greek (to 1453) {{m|grc|ἥλιος||sun}} (because its presence was first theorised in the sun\u0027s atmosphere).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A colorless and inert gas, and the second lightest chemical element (\u0027symbol\u0027 He) with an atomic number of 2 and atomic weight of 4.002602\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form or sample of the element\", \"priority\":2}]}, \"synonyms\":{}}");

