	add("helmet", "{\"term\":\"helmet\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"From \u0027healmet\u0027, \u0027helmet\u0027, an Old french (842-ca. 1400) diminutive of \u0027helme\u0027 (Modern French \u0027heaume\u0027 . The Old French is itself from the Proto-germanic \u0027helm\u0027. English since the 15th century, has gradually displaced Old english (ca. 450-1100) \u0027helm\u0027 as the generic word.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protective head covering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dNow that she had rested and had fed from the luncheon tray Mrs. Broome had just removed, she had reverted to her normal gaiety.\u0026amp;nbsp; She looked cool in a grey tailored cotton dress with a terracotta scarf and shoes and her hair a black silk \u0027\u0027helmet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which resembles a helmet in form, position, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The upper part of a chemist\u0027s retort\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The hood-shaped upper sepal or petal of some flowers, as of the monkshood or the snapdragon\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A naked shield or protuberance on the top or fore part of the head of a bird\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The feature above a shield on a coat of arms\", \"priority\":7}]}, \"synonyms\":{}}");

