	add("helve", "{\"term\":\"helve\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027helfe\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The handle or haft of a tool or weapon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, \u0027The Ax-helve\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was the bad ax-helve someone had sold me— / “Made on machine,” he said, plowing the grain\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Guy Davenport, \u0027Tatlin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The eyelet in the rose pilleum of his glans welled a clear bead that silled under the corona, wound the veinclomb \u0027\u0027helve\u0027\u0027, and ran a snailtrack down the thrum and ridge of the underduct\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 847\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Happily they were only sketchily armed, the group-leaders carried pistols and pick-\u0027\u0027helves\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A forge hammer lifted by a cam acting on the helve between the fulcrum and the head\", \"priority\":8}]}, \"synonyms\":{}}");

